import React from 'react';
import {Avatar, Paper} from '@mui/material';
import styles from './MainInfo.module.scss'

const Index = ({user}) => {
  return (
    <Paper className={styles.container}>
      <span>Hello </span>
      <Avatar src={user?.avatarUrl} /><span>{user?.name}</span>
    </Paper>
  );
};

export default Index;
